import React from "react";
import styled from "styled-components";
import background from "../assets/background.jpg";
const Skills = () => {
  return (
    <div>
      <Container>
        <span className="color" />
        <div className="container">
          <div className="list"></div>
        </div>
      </Container>
    </div>
  );
};

export default Skills;

const Container = styled.div`
  padding: 5%;
  position: relative;
  background-image: url(${background});
  background-attachment: fixed;
  background-size: cover;
  .container {
    padding: 3%;

    display: flex;
    align-items: center;
    margin: 0 auto;
    justify-content: center;
    position: relative;
    z-index: 1;
  }

  .imgDiv {
    width: 47%;
    -webkit-filter: grayscale(100%); /* Safari 6.0 - 9.0 */
    filter: grayscale(100%);
  }
  .nameHeader {
    font-size: 25px;
    font-weight: 400;
    padding-bottom: 17px;
    color: #2c2c2c;
  }
  .list {
    width: 42%;
    background-color: #f1f1f1;
    padding: 2%;
  }
  ul {
    list-style: none;
    text-align: left;
    width: 100%;

    p {
      color: #2c2c2cce;
      cursor: pointer;
    }
  }
  ul > li {
    font-weight: 500;
    font-size: 14px;
  }
  .color {
    position: absolute;
    left: 0;
    top: 0;
    opacity: 0.8;
    width: 100%;
    height: 100%;
    background-color: #182153;
  }
`;
